import { FaShoppingCart } from 'react-icons/fa'; // Importa el ícono de carrito

function CartWidget() {
  return (
    <div>
      <FaShoppingCart size={24} style={{ color: 'blue' }} />
      <span>3</span> {/* Número de items en el carrito */}
    </div>
  );
}

export default CartWidget;
